import Button from "../components/Button"

export default function Homepage() {
    return (
        <>
            <h1>Jobly</h1>
            <p>All the jobs in one convient place</p>
            <Button path='/signup' text='Sign Up'/>
            <Button path='/login' text='Log In'/>
        </>
    )
}
